package com.tsing.product.api.teambuilding.service;import com.tsing.global.result.ResultData;import com.tsing.global.result.ResultPageData;import com.tsing.product.api.teambuilding.bo.reponse.TeambuildingBoEntity;import com.tsing.product.api.teambuilding.bo.request.TeambildingPage;import com.tsing.product.api.teambuilding.bo.request.TeambuildingDeleteRequest;import com.tsing.product.api.teambuilding.bo.request.TeambuildingUpdateRequest;import org.junit.jupiter.api.Test;import org.springframework.boot.test.context.SpringBootTest;import javax.annotation.Resource;import lombok.val;@SpringBootTestclass TeambuildingServiceTest {    @Resource    private TeambuildingService teambuildingService;    @Test    public void testPageList() {        TeambildingPage pageParam = new TeambildingPage();        ResultData<ResultPageData<TeambuildingBoEntity>> teambuildingEntityIPage = teambuildingService.pageList(pageParam);        System.out.println(teambuildingEntityIPage);    }    @Test    public void testModify() {        TeambuildingUpdateRequest teambuildingUpdateRequest = new TeambuildingUpdateRequest();        teambuildingUpdateRequest.setId(1L);        teambuildingUpdateRequest.setName("修改团建名称");        final val modify = teambuildingService.modify(teambuildingUpdateRequest);        System.out.println(modify);    }    @Test    public void testDelete() {        TeambuildingDeleteRequest teambuildingDeleteRequest = new TeambuildingDeleteRequest();        teambuildingDeleteRequest.setId(1L);        final val delete = teambuildingService.delete(teambuildingDeleteRequest);        System.out.println(delete);    }}